import React from 'react';

const Navigation = () => {
	return (
		<nav>
		  <a href="/html/">HTML</a>
		  <a href="/css/">CSS</a>
		  <a href="/js/">JavaScript</a>
		  <a href="/jquery/">jQuery</a>
		</nav>
	);
}


export default Navigation
